import React from 'react';

class Type extends React.Component{
    render(){
        let type = this.props.type
        switch (type) {
            case 'email':
                status = 'Email';
                break;
            case 'tag_manager':
                status = 'Tag Manager';
                break;
            case 'dmp_crm':
                status = 'DMP / CRM';
                break;
            case 'analytics':
                status = 'Analytics';
                break;
            case 'heatmap':
                status = 'Heatmap';
                break;
        }
        return (
            
            <div>{this.props.type}</div>
        )
    }
}


export default Type;
